  false,\n\t\"url\": null,\n\t\"notes\": \"Lingcod (Ophiodon elongatus) populations
  along the West Coast of North America have recovered from overfishing, but the status
  of genetically distinct lingcod in Puget Sound, Washington is less clear. This project
  will use small-scale lingcod releases to learn about the benefits and risks of using
  stock enhancement as a tool to help rebuild marine fish populations. We have conducted
  experiments to improve rearing methods, improve release methods, and learn about
  lingcod life history, and are proceeding with a before-after-control-impact study
  that will quantify ecological impacts on wild fishes. WDFW collaborates on this
  project by conducting creel surveys.nnThis project has been or is currently supported
  by the Science Consortium for Ocean Replenishment, the Puget Sound Recreational
  Fisheries Enhancement Fund, and NOAA Aquaculture. Previous or present partners include
  the Northwest Indian Fisheries Commission, the Nisqually Tribe, WDFW, and the Washington
  SCUBA Alliance.nnData from mobile Vemco VR28 acoustic hydrophone array towed behind
  a boat in South Puget Sound.  Contains detections of hatchery lingcod.\",\n\t\"owner_org\":
